styles:

      #inputSection {
        display: none;
      }

      .menubar {
        box-sizing: content-box;
      }

      #ctrlNumberLabelLine {
       width:100%;
      } 

      #pinNumberLabelLine {
       width:50%;
       min-width: 200px;
      } 	

      input[type='text'].inputPrompt, input[type='password'].inputPrompt {
        width:100%;
      }

      input.inputPrompt {
        padding: 4px;
        font-size: 18px;
      }	  

      a img {vertical-align: bottom; border:0;}




      #loginPage {
        overflow: hidden;
        padding: 0;
        float: left;
        background-color:#3a9bbf;
        width:100%;
      }  

      #bannerSection {
        margin:0;
         background-color:#fff;
      }           

      #leftBanner, #rightBanner  {
        text-align:left;      
        margin: 0;
        padding: 0 2%;   
      }

      #leftBanner  {
        text-align:left;
      }

      #rightBanner  {
        text-align:right;
      }            

      #mainSection {
  		margin: 1% 0 2% 0;      
      }

      #leftSection {
        margin: 0;
        padding: 0 2%;   
      }

      #rightSection {
        margin: 0;
        min-width:250px;        
        padding: 0 2%; 
      }

      #pwdSection {
        margin: 5% 0 0 0;
      }

      #leftSectionContent > li,        
   	  #leftSectionContent > p,                    
      p.sectionTextLeft {
        min-width:250px;
        width:100%;
      }

      p.foreignDualAuthBypassText {
        margin: 5px 0;
      }  

      #ctrlNumberPrompt {
        font-style:italic;
              }          

      #leftSectionContent li,
   	  #leftSectionContent p,               
      h1.sectionTitle, p.sectionText, li.sectionListItem, label.labelHeader {  
        color:#f2f2f2;
        font-family:Arial, sans-serif;
      }  

      .sectionTitle {
        height: 45px;
        padding:0;
        margin:15px 0;
      }  

   	  #leftSectionContent p,            
      p.sectionText {
        font-size:18px;
        font-weight:300;
        line-height:1.2;
        padding:0 0 3% 0;
      }       

      h1.sectionTitle {  
                        font-size:30px;
        font-weight:900;
        letter-spacing:-1px;
        line-height:1;
        padding:0 0 3% 0;
      }      

      #leftSectionContent li,      
      li.sectionListItem {
                        font-size:18px;
        font-weight:300;
        line-height:1.2;
        padding:0 0 2% 0;
      }       

      label.labelHeader {  
                        font-size:14px;
        font-weight:400;
      } 

      span.labelInfo, p.foreignDualAuthBypassText {  
        color:#233569;
        font-weight:400;
        font-size:14px;
        font-family:Aria, sans-serif;
      }

      #submitButton {
        min-height:42px;
        width:130px;
        font-weight:Normal;
        font-size:16px;
        font-family:Arial, sans-serif;
        color:#000;
        background-color:#e7e7e7;
        border:1px solid #000;
        margin:7% 0 0 0;

      }

      #errorMessage {
        color:#fff;
        font-weight:bold;
        font-size:13px;
        font-family:Arial, sans-serif;
      }  

      #submitButton:hover, #submitButton:focus {
        background-color:#d2d1cf;
      }

      input.inputPrompt:hover, input.inputPrompt:focus, #submitButton:hover, #submitButton:focus {
              -webkit-box-shadow: 0 12px 16px 0 rgba(0,0,0,0.24), 0 17px 50px 0 rgba(0,0,0,0.19);
        -moz-box-shadow   : 0 12px 16px 0 rgba(0,0,0,0.24), 0 17px 50px 0 rgba(0,0,0,0.19);
        box-shadow        : 0 12px 16px 0 rgba(0,0,0,0.24), 0 17px 50px 0 rgba(0,0,0,0.19);                 
            }

	  input.inputPrompt::-webkit-input-placeholder {
	    font-style : italic !important;  
	  }      
	  input.inputPrompt:-moz-placeholder{
		font-style : italic !important;  
	  }      
      input.inputPrompt::-moz-placeholder{
        font-style : italic !important;  
	  }      
      input.inputPrompt:-ms-input-placeholder  {
		font-style : italic !important;  
      }      

      #baseSection {
        background: transparent url("/branding/static/images/vote_base_banner.jpg") no-repeat center center;
        background-size:cover;
        height: 250px;
        min-height: 250px;
        width: 100%;
        margin:3% 0;
      }      

      #footerSection {
        padding: 15px 0;
        background-color:#fff;
      }  

	  p.footer,p.footer a,p.footer a:link,p.footer a:visited,p.footer a:active,p.footer a:hover {
  		color:#949494;
  		font-size:11px;
  		font-weight:normal;
  		font-family:Verdana, Tahoma, Geneva, sans-serif;
  		text-align:center;
      }       

      a.info {
        color:#333333;
        font-family:Arial, Helvetica, sans-serif;
        font-size:13px;
        font-weight:normal;
        position:relative;
        color:#000;
      }

      a.info:active {
        position:relative;
        top:1px;
        left:1px;   
      }


      a.info:hover, a.info:focus{
        text-decoration:none;
      }

      a.info span {
        position: absolute;
        right: -900em;      
        width: 0;
        overflow: hidden;
      }     

      a.info:hover span, a.info:focus span, a.info:active span {
        display:block;
        position:absolute;
        top:1em;
        right:0.2em;
        width:9.5em;
        border:1px solid #000;
        color:#000;
        text-align: center;
        background-color: #ffffff;
        z-index:25;
      }
